import React, { useState } from "react";

function MouseTracker({ render }) {
  const [coords, setCoords] = useState({ x: 0, y: 0 });

  const handleMouseMove = (event) => {
    setCoords({
      x: event.clientX,
      y: event.clientY,
    });
  };

  return (
    <div onMouseMove={handleMouseMove}>
      {render(coords)}
    </div>
  );
}

function App() {
  return (
    <div>
      <h1>Mouse Tracker</h1>
      <MouseTracker
        render={({ x, y }) => <p>Mouse Position: ({x}, {y})</p>}
      />
    </div>
  );
}

export default App;
